import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Header from "./components/Header";
import Footer from "./components/Footer";
import ListUserFormElementsComponent from "./components/ListUserFormElementsComponent";
import AddElement from "./components/AddElement";

import UpdateForm from "./components/UpdateForm";
import CreateElement from "./components/CreateElement";

function App() {
  return (
    <div>
      <Router>
        <Header />

        <Routes>
          <Route exact path="/user-form" element={<ListUserFormElementsComponent />}></Route>
          <Route path="/add-element" element={<AddElement />}></Route>

          <Route path="/update-form-element/:id" element={<UpdateForm />}></Route>

          <Route path="/build-element/:id" element={<CreateElement />}></Route>
        </Routes>

        <Footer />
      </Router>
    </div>
  );
}

export default App;
